script: |
  super -f text -I q11753.spq | sort > q11753.out

inputs:
  - name: q11753.spq
    data: |
      SELECT DISTINCT - col1 * - col0 + + tab0.col0 * col1 + tab0.col0 * - col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL BETWEEN NULL AND - col2;
  - name: tab0

outputs:
  - name: q11753.out
    data: |
